import React from 'react';

export const Icon = (src, alt) => {
  const getIcon = () => {
    if (src === 'mail') {
      return 'https://cdn4.iconfinder.com/data/icons/evil-icons-user-interface/64/mail-512.png';
    }
  }
  return (
    <img
      className={['logo w-full h-full',].join(' ')}
      src={getIcon()}
      alt={JSON.parse(alt).toString()}>
    </img>
  );
};
